import React from "react";
import { BrowserRouter as Router, Route ,NavLink} from "react-router-dom";
import { Header, HeaderLi, HeaderLogo, HeaderUl } from "./home-components";
import { Container ,Ul,Li,Ul1,Li1 ,TitleHed,TitleHedText,Hamburger,Bar,Menu,X} from "./home-components";
import Logo from "./icon/photo-logo.jpg";
import "./app.css"
import About from "./components/About"
import Contacts from "./components/Contacts"
import Portfolio from "./components/Portfolio"
import Skils from "./components/Skils"
function App() {

  const handdleClick = () => {
    document.getElementById('home').style.display = "none";
    document.getElementById('menu-2').style.display = "flex";
}
const handdleCheck = () => {
    document.getElementById('home').style.display = "grid";
    document.getElementById('menu-2').style.display = "none";
}

  return (
    <div>
      <Router>
        <Header>
          <HeaderLogo>
            <img src={Logo} alt="" style={{ width: "60px", height: "60px", borderRadius: "50%" }} />
            <h1 style={{ color: "#fff" }}>Ozodbek</h1>
          </HeaderLogo>
          <HeaderUl id="none">
            <NavLink  to="/" exact style={{ textDecoration: 'none' }}><HeaderLi>Oбо мне</HeaderLi></NavLink>
            <NavLink  to="/skils" style={{ textDecoration: 'none' }}><HeaderLi>Изучал </HeaderLi></NavLink>
            <NavLink  to="/portfolio" style={{ textDecoration: 'none' }}><HeaderLi>Портфолио </HeaderLi></NavLink>
            <NavLink  to="/contacts" style={{ textDecoration: 'none' }}><HeaderLi>Контакты </HeaderLi></NavLink> 
          </HeaderUl>
          <Container id='home' >
                        <Hamburger onClick={handdleClick}>
                            <Bar></Bar>
                            <Bar></Bar>
                            <Bar></Bar>
                        </Hamburger>
                        </Container>
                        <Menu id='menu-2'>
                        <X onClick={handdleCheck}>
                            X
                        </X>
                </Menu>
        </Header>

        <Route path="/" exact component={About}/>
        <Route path="/contacts" component={Contacts} />
        <Route path="/skils" exact component={Skils} />
        <Route path="/portfolio" component={Portfolio} />
      </Router>
    </div>
  );
}

export default App;
